import React,{Component} from 'react';

export default class CreatePost extends Component{
    constructor(props){
        super(props)
        this.state = {
            username:'',
            content:'',
            title:'',
            date: new Date(),
            price:0,
            image:'',
            users:[],
        }
    }
    onChange(e){
        this.setState({
            [e.target.id]:e.target.value
        });
    }
    render() {
        return(
        <div><p>This creates a Post</p></div>
        );
    }
}
